import serviceImg1 from "../src/images/ser-1.jpg";

const Sdata = [
    {
        imgsrc: serviceImg1,
        title: "Web Development",
    },
    {
        imgsrc: serviceImg1,
        title: "App Development",
    },
    {
        imgsrc: serviceImg1,
        title: "Android Development",
    },
    {
        imgsrc: serviceImg1,
        title: "Desktop Development",
    },
    {
        imgsrc: serviceImg1,
        title: "IOS Development",
    },
    {
        imgsrc: serviceImg1,
        title: "Java Development",
    },
];

export default Sdata;
